Job Description:
Nursery Coordinator

No corp to corp or sponsorship

Responsibilities

- Assist in the design, creation and management of nursery trials;

- Submit capacity and assay requests to partner labs and teams through enterprise IT systems

- Work with large, complex datasets and computer systems to provide insights for data- driven decisions;

- Work with stakeholders across site functions to track KPIs;

- Assist with in-depth and ad-hoc analysis of information from multiple data sources;

- Increase data accessibility within the organization by enabling scheduled reporting and monitoring in non-graphic or graphic form;

- Use forecasts to help manage greenhouse capacity;

- Accurately forecast, create and analyze molecular assay projects to advance elite genetics while ensuring trait quality;

- Be able to work extended hours during peak seasons;

Required Skills / Experience

- BS in data science, life sciences, engineering, statistics or related field PLUS at least one year of work experience with reporting, data management, or data analytics

OR

- An equivalent combination of related experience/education

ALSO

- Experience with large data sets

- Excellent Excel skills

- Ability quickly understand a number of processes with consistency and attention to data quality and accuracy

Desired Skills and Experience

- Experience with visualization software (Tibco SpotFire, Tableau, Power BI, etc.)

As a Data Analyst, the primary responsibility is to acquire and transform clinical and health data from Inovalon’s technical platforms and databases to create impactful, dynamic, and insightful healthcare data analytics such as opportunity analyses, pharma reports/ extracts and program evaluation studies, customer reporting, product development, and ad-hoc analytics.
Responsibilities: *
Performs detailed statistical analyses and modeling of clinical and operational data with outputs that are clear and relevant to the users;
Participates in the design and development of analyses and reports that explore and present large amounts of data to discover underlying patterns and trends related to quality, safety, and clinical performance;
Works with information from a variety of sources, including the Specialty Pharmacy and Pharma data, and other sources using a variety of highly-specific tool such as, but not limited to, Oracle, SQL or Tableau;
Develop requirements for data mapping and data loading processes. Execute data mapping/loading requirements and reconciliation of such activities;
Assist with the design of data integration strategies, develop intuitive designs, and build enterprise interactive dashboards with built in guided healthcare data analytics;
Identify and research anomalies and outliers in data. Identify problematic areas and conduct research to determine the best course of action to correct the data;
Monitor and perform trend analysis for the company and research report on anomalies Maintain compliance with Inovalon’s policies, procedures and mission statement;
Maintain compliance with Inovalon’s policies, procedures and mission statement;
Adhere to all confidentiality and HIPAA requirements as outlined within Inovalon’s Operating Policies and Procedures in all ways and at all times with respect to any aspect of the data handled or services rendered in the undertaking of the position; and
Fulfill those responsibilities and/or duties that may be reasonably provided by Inovalon for the purpose of achieving operational and financial success of the Company.
Qualifications: *
At least 3 years of experience in data analytics, data science, or related field;
Experience with data management and visualization tools, such as SQL and Tableau, Power BI, and Oracle APEX;
Possession of strong analytical / statistical skills used in evaluating and analyzing data;
Strong organization skills and attention to details, comfortable working with minimum direction;
Adaptable to changing organizational requirements and priorities and supportive of a diverse work force;
Ability to collaborate with others in diplomatic, tactful manner, while exercising sensitivity and discretion as needed;
Specialty Pharmacy and/ or Pharma Industry Experience is preferred;
Advanced PC skills (Excel, PowerPoint, Word, Visio, and other programs); and
Excellent written and verbal communication skills.
Bachelor’s degree in Information Systems, Computer Science, Statistics, Analytics, or a related field of study;
Physical Demands and Work Environment:
Sedentary work ( i.e. sitting for long periods of time) Exerting up to 10 pounds of force occasionally and/or negligible amount of force;
Frequently or constantly to lift, carry push, pull or otherwise move objects and repetitive motions
Subject to inside environmental conditions; and
Travel for this position will include less than 5% locally usually for training purposes.
Inovalon provides equal employment opportunities (EEO) to all employees and applicants for employment. All qualified applicants will receive consideration for employment without regard to race, color, religion, sex, national origin, or protected veteran status and will not be discriminated against on the basis of disability.

